import { Link } from 'react-router-dom';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import { Button, Typography } from '@mui/material';

const MyAppBar = () => (
  <AppBar position="static">
    <Toolbar>
      <Typography variant="h6" style={{ flexGrow: 1 }}>
        Mi PÃ¡gina Web
      </Typography>
      <Button color="inherit" component={Link} to="/" style={{ marginRight: '10px' }}>
        Inicio
      </Button>
      <Button color="inherit" component={Link} to="/todolist" style={{ marginRight: '10px' }}>
        To-Do List
      </Button>
      <Button color="inherit" component={Link} to="/tictactoe" style={{ marginRight: '10px' }}>
        Tic-Tac-Toe
      </Button>
    </Toolbar>
  </AppBar>
);

export default MyAppBar;
